        header {

            padding: 30px;
            text-align: center;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.3);
        }

        h1 {
            margin: 0;
            font-size: 2em;
            letter-spacing: 2px;
        }

        #joinButton {
            background-color: #ff416c;
            border: none;
            color: white;
            padding: 15px 30px;
            border-radius: 40px;
            margin-top: 20px;
            cursor: pointer;
            font-size: 1em;
            transition: background-color 0.3s, transform 0.3s;
        }

        #joinButton:hover {
            background-color: #ff4b2b;
            transform: scale(1.05);
        }

        .search-bar {
            display: flex;
            justify-content: center;
            margin: 30px 0;
        }

        #searchInput {
            width: 70%;
            padding: 15px;

            border: none;
            font-size: 1em;
            background-color: #2e2e2e;
            color: #ffffff;
        }

        #searchButton {
            padding: 15px 30px;
            background-color: #4CAF50;
            color: white;
            border: none;
            border-radius: 0 50px 50px 0;
            cursor: pointer;
            font-size: 1em;
            transition: background-color 0.3s, transform 0.3s;
        }

        #searchButton:hover {
            background-color: #45a049;
            transform: scale(1.05);
        }

        .filter-dropdown {
            text-align: center;
            margin-bottom: 30px;
        }

        #categoryFilter {
            padding: 15px;
            border-radius: 50px;
            border: none;
            font-size: 1em;
            background-color: #2e2e2e;
            color: #ffffff;
        }

        .channel-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
            gap: 30px;
            padding: 20px;
        }

        .channel-item {
            background-color: #1f1f1f;
            border-radius: 20px;
            padding: 20px;
            text-align: center;
            transition: transform 0.3s, box-shadow 0.3s;
            cursor: pointer;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.3);
        }

        .channel-item:hover {
            transform: scale(1.1);
            box-shadow: 0 6px 15px rgba(0, 0, 0, 0.5);
        }

        .channel-item img {
            width: 100px;
            height: 100px;
            border-radius: 20%;
        }

        .channel-item p {
            margin: 15px 0 0;
            font-size: 1.2em;
        }

        @media (max-width: 768px) {
            #searchInput {
                width: 60%;
            }
        }

        @media (max-width: 480px) {
            #searchInput {
                width: 50%;
            }

                grid-template-columns: repeat(auto-fill, minmax(150px, 1fr));
            }
        }
